import React from 'react';

const Profile = props => {
    const history = useHistory();
    return (
        <>
          <h2>Profile</h2>      
          <button onClick={ () => {
              history.push('/profile');
          }}>Go to Home</button>
          </>
        );
}


export default Profile;
